import './App.css';
import React from 'react';

class App extends React.Component {
  state ={
    name:'cx',
    age:'16'
  }
  onClick=(a,e)=>{
    this.setState({
      name:a,
      age:e.target.value
    })
  }
  render() {
    return (
      <div className="App">
        <div>{this.state.name}</div>
        <div>{this.age}</div>
        <button onClick={(e)=>this.onClick('cxnb',e)}>修改</button>
      </div>
    );
  }
}
export default App;
